import './App.css';
import MainPage from './assets/components/mainPage/MainPage';
import UserLogin from './assets/components/Login/UserLogin';
import {
  Redirect,
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useLocation,
  useHistory,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <Router>
        <Switch>
          <Route exact path="/">
            <MainPage />
            <Redirect to="/login" />
          </Route>

          <Route path="/login">
            <LoginPage />
          </Route>

          <Route path="/register">
            <RegisterPage />
          </Route>

          <PrivateRoute path="/detail">
            <UserDetailPage />
          </PrivateRoute>
        </Switch>
      </Router>

      
        <UserLogin />
        <MainPage/>
    </div>
  );
}

export default App;
